import  React,{ useState } from 'react';


class Profile extends React.Component {
    constructor(props) {
        super(props)
        this.state = {
            className: "profile",
            photoClassName:"profile-photo"
        }
    }
    render() {
        console.log(this.props)
        return (
        <div className="profileContainer">
        <div
            className={this.state.className}
            onMouseOver={() => this.setState({ className:"profile-hover",photoClassName:"profile-photo"})}
            onMouseLeave={() => this.setState({ className: "profile"})}
                >
                    <div className="profile-layout-left">
                        <img src={this.props.profile.imagePortraitUrl} className="profile-photo"></img>

                    </div>
                    <div className="profile-layout-right">

                        <p>{this.props.profile.name}</p>
                    </div>

            </div>
            </div>
    )
    }

}

export default Profile
